script: |
  super -f text -I q12739.spq | sort > q12739.out

inputs:
  - name: q12739.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 + + col1 + - col1 * - col1 NOT BETWEEN ( - col0 ) AND ( col0 * - 10 * - ( col2 ) + - col0 );
  - name: tab2

outputs:
  - name: q12739.out
    data: |
      46	51	23
      64	77	40
      75	67	58
